izona Bound is a lost 1927 American Western silent film directed by John Waters and starring Gary Cooper, Betty Jewel, and El Brendel.                                                                                                                                                                                                                   |\r\n\t  | King Kong         | King Kong is a 1933 American pre-Code disaster film directed and produced by Merian C. Cooper and Ernest B. Schoedsack. The screenplay by James Ashmore Creelman and Ruth Rose was from an idea conceived by Cooper and Edgar Wallace. It stars Fay Wray, Bruce Cabot and Robert Armstrong, and opened in New York City on March 2, 1933, to rave reviews. |\r\n\t  | PCC 2000          | PCC 2000 is a professional computer released in 1978. It was designed in 1978 by Pertec, the company which merged with MITS by the end of 1976.                                                                                                                                                                                                            |\r\n\t  | Pingus            | Pingus is a free, open-source computer game inspired by Lemmings and created by Ingo Ruhnke. It is a video game clone of Lemmings and features penguins instead of lemmings.                                                                                                                                                                               |\r\n\t  | The Doctor In War | The Doctor In War is a book published in November 1918 by Woods Hutchinson, an American medical doctor who travelled throughout Europe from 15 January to 24 December 1917 visiting hospitals, ambulance trains, and other locations to offer his services to the war effort during World War I.                                                           |\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///D:/SWTesting/group15/src/test/resources/lab/DisplayItem :[],"astNodeIds":["bd3b085e-d123-4c39-872e-0b4048b1c4ef","41c44482-058a-4a16-93ef-b705809f9fa7"]}},{"source":{"uri":"file:///D:/SWTesting/group15/src/test/resources/lab/AccountInformation.feature","data":"Feature: Edit account information details\n\n  As a customer I want to edit my personal account information details.\n\n  Scenario Outline: I have moved and want to change my address\n    Given I login with valid credentials\n    When I navigate to my profile\n\tAnd I change my address to \"<street>\", \"<zip>\", \"<city>\", \"<country>\"\n\tAnd I submit my changes\n\tThen A confirmation notification is shown\n\tAnd I can see my new address on my profile\n\n    Examples:\n      | street            | zip  \t\t| city   | country |\n      | Gusshausstraße 28 | 1040 \t\t| Vienna | Austria |\n\t  | Gusshausstraße 28 | 1234567891 \t| Vienna | Austria |\n\n  Scenario Outline: I mistakenly input an invalid value in one of the fields\n\tGiven I login with valid credentials\n\tWhen I navigate to my profile\n\tAnd I change my name to \"<firstname>\" \"<lastname>\"\n\tAnd I change my date of birth to \"<dateofbirth>\"\n\tAnd I change my address to \"<street>\", \"<zip>\", \"<city>\", \"<country>\"\n\tAnd I submit my changes\n\tThen An error message is shown\n\tAnd My old data is unchanged\n\n\tExamples:\n\t  | firstname | lastname \t| dateofbirth \t| street            \t| zip  \t\t\t| city   \t| country |\n\t  | Spongebob | Squarepants | 06/14/1986\t| Gusshausstraße 28 \t| 104 \t\t\t| Vienna \t| Austria |\n\t  | Spongebob | Squarepants | 06/14/1986 \t| Gusshausstraße 28 \t| 123456789012 \t| Vienna \t| Austria |\n\t  | Spongebob | Squarepants | 06/14/1986 \t|  \t\t\t\t\t\t| 1040 \t\t\t| Vienna \t| Austria |\n\t  | Spongebob | Squarepants | 06/14/1986 \t| Gusshausstraße 28 \t| 1040 \t\t\t|  \t\t\t| Austria |\n\t  | \t\t  | Squarepants | 06/14/1986\t| Gusshausstraße 28 \t| 1040 \t\t\t| Vienna \t| Austria |\n\t  | Spongebob | \t\t\t| 06/14/1986\t| Gusshausstraße 28 \t| 1040 \t\t\t
